# 436. 寻找右区间
# https://leetcode-cn.com/problems/find-right-interval/

# Definition for an interval.
class Interval(object):
    def __init__(self, s=0, e=0):
        self.start = s
        self.end = e

class Solution(object):
    def findRightInterval(self, intervals):
        """
        :type intervals: List[Interval]
        :rtype: List[int]
        """
        if not intervals:
            return []
        if len(intervals) == 1:
            return [-1]
        for index, interval in enumerate(intervals):
            interval.end = [interval.end, index]
        intervals.sort(key=lambda x:x.start)
        result = [-1 for _ in range(len(intervals))]
        for index, interval in enumerate(intervals):
            # print(interval.start, interval.end)
            left = 0
            right = len(intervals) - 1
            while left <= right:
                mid = (left + right) // 2
                if left == right:
                    if intervals[mid].start >= interval.end[0]:
                        result[interval.end[1]] = intervals[mid].end[1]
                        break
                a = intervals[mid].start
                if intervals[mid].start >= interval.end[0]:
                    result[interval.end[1]] = intervals[mid].end[1]
                    # break
                if intervals[mid].start < interval.end[0]:
                    left = mid + 1
                else:
                    right = mid - 1
        return result



